import React from 'react';

class Login extends React.Component {

    handleChange = (e) => {
        e.preventDefault();
        let {name, value} = e.target;
        this.setState({
            [name]: value.toLowerCase()
        },
        console.log(name, value));
    };


    render() {
        return (
            <div>
                <form>
                    <input className={"d-none d-md-inline"} placeholder={"email"}  name={"emailLogin"}/>
                    <input className={"d-none d-md-inline"}  name={"city"}/>
                </form>
            </div>
        )
    }
}

export default Login;
